import React from "react";
import IconArrowDown from "./../Icons/IconArrowDown";
import "./ShowDetailsButton.scss";
import { faPhone } from '@fortawesome/free-solid-svg-icons'

const ShowDetailsButton = ({ onClick }) => (
  <button onClick={onClick} className="show-details-button">
    <span>

    <FontAwesomeIcon icon={faPhone} />
      <button style={{ marginLeft: "80px" }}>Btn 1</button>
      <button style={{ marginLeft: "80px" }}>Btn 2</button>
      <button style={{ marginLeft: "80px" }}>Btn 3</button>
      <IconArrowDown />
    </span>
  </button>
);

export default ShowDetailsButton;
